using System;

public static class Snippet
{
	public static void func(ref Microsoft.Web.WebView2.WinForms.WebView2 webView2, System.String url)
	{

		var uri = new Uri(url);
		webView2.Source = uri;	
		webView2.CoreWebView2.Settings.AreDefaultContextMenusEnabled = false;

	}

}

using System;
using System.Threading.Tasks;
using System.Windows.Threading;
using System.Windows;

public static class Snippet
{
	public static void func(ref Microsoft.Web.WebView2.WinForms.WebView2 webView2, ref System.String mgFirstname, ref System.String mgLastname)
	{

		string sFirstname = CustomWait(webView2.ExecuteScriptAsync("document.getElementById('firstname').value;"));
		string sLastname = CustomWait(webView2.ExecuteScriptAsync("document.getElementById('lastname').value;"));

		mgFirstname = System.Text.RegularExpressions.Regex.Unescape(sFirstname).Trim('"');
		mgLastname = System.Text.RegularExpressions.Regex.Unescape(sLastname).Trim('"');

	}

	 private static string CustomWait(Task<string> task)
      {
            System.Timers.Timer timer = new System.Timers.Timer();
            DispatcherFrame frame = new DispatcherFrame();  

            string wait = "";

            task.ContinueWith(
                _ =>
                {
                    if (task.IsFaulted) wait = task.Exception.Message;
                    else wait = task.Result;
                    frame.Continue = false;
                });

            // Timeout if task takes too long
            timer.Enabled = true;
            frame.Continue = true;
            Dispatcher.PushFrame(frame);
            timer.Enabled = false;

            return wait;
        }
}

using System;

